import React, { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom'
import {
  Alert,
  Button,
  Container,
  Dropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  Tooltip,
  Modal,
  ModalBody,
  ModalFooter,
  ModalHeader,
} from 'reactstrap'
import {
  fetchStaticAllFilesFromAPI,
  fetchStaticFilteredDataFromAPI,
} from '../../api/StaticData'

const MainPage = () => {
  const navigate = useNavigate()
  const [dataset, setDataset] = useState([])
  const [saveDataset, setSaveDataset] = useState([])
  const [showUsersList, setShowUsersList] = useState(false)
  const [allUsers, setAllUsers] = useState([])
  const [checkedUsers, setCheckedUsers] = useState([])
  const [filteredUsers, setFilteredUsers] = useState([])
  const [modal, setModal] = useState(false)
  const [showToast, setShowToast] = useState(false)
  const [showNoUsers, setShowNoUsers] = useState(false)
  const [dropdownOpen, setDropdownOpen] = useState(false)
  const [tooltipOpen, setTooltipOpen] = useState({})

  useEffect(() => {
    const fetchDataset = async () => {
      try {
        const fetchedDataset = await fetchStaticAllFilesFromAPI()
        setDataset(fetchedDataset)
      } catch (error) {
        console.error('Error fetching Dataset:', error)
      }
    }

    fetchDataset().catch((error) =>
      console.error('Error fetching Dataset:', error)
    )
  }, [])
  console.log('Dataset: ', dataset)
  const handleDatasetClick = async (datasetName) => {
    try {
      const fetchedUsersData = await fetchStaticAllFilesFromAPI(datasetName)
      if (fetchedUsersData.length === 0) {
        setShowNoUsers(true)
        return
      }
      setAllUsers(fetchedUsersData || [])
      setSaveDataset(datasetName)
      setShowUsersList(true)
      setCheckedUsers([])
      setFilteredUsers([])
      setModal(!modal)
    } catch (error) {
      console.error('Error fetching Users Data:', error)
    }
  }

  useEffect(() => {
    if (showNoUsers || showToast) {
      const timer = setTimeout(() => {
        setShowNoUsers(false)
        setShowToast(false)
      }, 2000)
      return () => clearTimeout(timer)
    }
  }, [showNoUsers, showToast])

  const handleBackClick = () => {
    setShowUsersList(false)
    setModal(false)
    setAllUsers([])
    setCheckedUsers([])
    setFilteredUsers([])
  }

  const handleSubmitClick = async (datasetName) => {
    if (filteredUsers.length === 0) {
      setShowToast(true)
      return
    }
    try {
      const fetchedFilteredData = await fetchStaticFilteredDataFromAPI(
        datasetName,
        filteredUsers
      )
      const updatedData = fetchedFilteredData || []

      navigate('/overview', {
        state: {
          receivedData: updatedData,
          dataset: saveDataset,
          totalUsers: allUsers,
          selectedUsers: checkedUsers,
        },
      })

      setShowUsersList(false)
    } catch (error) {
      console.error('Error fetching Filtered data:', error)
    }
  }

  const datasetDuration = allUsers.reduce(
    (total, user) => total + user.duration,
    0
  )

  const handleCheckboxChange = (user) => {
    setCheckedUsers((prevCheckedUsers) => {
      const isChecked = prevCheckedUsers.includes(user)
      const updatedUsers = isChecked
        ? prevCheckedUsers.filter((u) => u !== user)
        : [...prevCheckedUsers, user]
      transformUsers(updatedUsers)
      return updatedUsers
    })
  }

  const handleSelectAllUsers = (allUsers) => {
    transformUsers(allUsers)
    setCheckedUsers(allUsers)
  }

  const transformUsers = (checkedUsers) => {
    const transformedUsers = checkedUsers.map((userObj) => {
      const userName = userObj.user
      return userName.replace(/\D/g, '')
    })
    setFilteredUsers(transformedUsers)
  }

  const sortedDataset = dataset.sort((first, second) =>
    first.dataset.localeCompare(second.dataset)
  )

  const toggleDropdown = () => setDropdownOpen((prevState) => !prevState)

  const toggleTooltip = (index) => {
    setTooltipOpen((prev) => ({ ...prev, [index]: !prev[index] }))
  }

  const tooltipData = (file) => [
    {
      label: 'Name',
      value: file.dataset !== null ? file.dataset : 'No dataset Name',
    },
    {
      label: 'Number of Users',
      value: file.users !== null ? file.users : 'No users',
    },
    {
      label: 'Dataset Time',
      value:
        file.total_duration !== null ? `${file.total_duration} s` : 'No time',
    },
    {
      label: 'Number of Types',
      value: file.type_counts ? file.type_counts : 'No data',
    },
    {
      label: 'Number of Event Types',
      value: file.event_type_counts ? file.event_type_counts : 'No data',
    },
  ]

  return (
    <div className="main-container">
      <div className="title">
        <h1 className="title-text">
          Visualization and Analysis <br /> of <br /> Multimodal Interaction
        </h1>
      </div>
      <div className="nav-container">
        <Container>
          <Dropdown isOpen={dropdownOpen} toggle={toggleDropdown}>
            <DropdownToggle caret>Choose your Dataset</DropdownToggle>
            <DropdownMenu>
              {sortedDataset.map((file, index) => (
                <DropdownItem
                  key={index}
                  onClick={() => handleDatasetClick(file.dataset)}
                  id={`tooltip-${index}`}
                  onMouseEnter={() => toggleTooltip(index)}
                  onMouseLeave={() => toggleTooltip(index)}
                >
                  <div>
                    <strong>{file.dataset}</strong>
                    <Tooltip
                      style={{ maxWidth: '250px' }}
                      placement="right"
                      isOpen={tooltipOpen[index] || false}
                      target={`tooltip-${index}`}
                    >
                      <ul
                        style={{
                          textAlign: 'left',
                          listStyleType: 'none',
                          padding: 0,
                          margin: 0,
                        }}
                      >
                        <li>
                          <span style={{ fontWeight: 'bold', color: '#333' }}>
                            Name:{' '}
                          </span>
                          {file.dataset !== null
                            ? file.dataset
                            : 'No dataset Name'}
                        </li>
                        <li>
                          <span
                            style={{
                              fontWeight: 'bold',
                              color: '#333',
                              fontSize: '14px',
                            }}
                          >
                            Number of Users:{' '}
                          </span>
                          {file.users !== null ? file.users : 'No users'}
                        </li>
                        <li>
                          <span
                            style={{
                              fontWeight: 'bold',
                              color: '#333',
                              fontSize: '14px',
                            }}
                          >
                            Dataset Time:{' '}
                          </span>
                          {file.total_duration !== null
                            ? `${file.total_duration} s`
                            : 'No time'}
                        </li>
                        <li>
                          <span
                            style={{
                              fontWeight: 'bold',
                              color: '#333',
                              fontSize: '14px',
                            }}
                          >
                            Number of Types:{' '}
                          </span>
                          <ul
                            style={{
                              padding: 0,
                              margin: 0,
                              listStyleType: 'none',
                            }}
                          >
                            {file.type_counts
                              ? Object.entries(file.type_counts).map(
                                  ([type, count]) => (
                                    <li key={type}>
                                      {type}: {count}
                                    </li>
                                  )
                                )
                              : 'No types'}
                          </ul>
                        </li>
                        <li>
                          <span
                            style={{
                              fontWeight: 'bold',
                              color: '#333',
                              fontSize: '14px',
                            }}
                          >
                            Number of Event Types:{' '}
                          </span>
                          <ul
                            style={{
                              padding: 0,
                              margin: 0,
                              listStyleType: 'none',
                            }}
                          >
                            {file.event_type_counts
                              ? Object.entries(file.event_type_counts).map(
                                  ([eventType, count]) => (
                                    <li key={eventType}>
                                      {eventType}: {count}
                                    </li>
                                  )
                                )
                              : 'No event types'}
                          </ul>
                        </li>
                      </ul>
                    </Tooltip>
                  </div>
                </DropdownItem>
              ))}
            </DropdownMenu>
          </Dropdown>
        </Container>
      </div>
      <Modal isOpen={modal}>
        <div className="modalStyle">
          <ModalHeader className="modalHeader">List of Users</ModalHeader>
          {showToast && (
            <div>
              {['warning'].map((variant) => (
                <Alert key={variant} color={variant}>
                  Please select at least one user!
                </Alert>
              ))}
            </div>
          )}
          <ModalBody>
            {showUsersList && (
              <div className="usersList">
                <ul>
                  {allUsers.map((user, index) => (
                    <li key={index} className="userItem">
                      <input
                        type="checkbox"
                        checked={checkedUsers.includes(user)}
                        onChange={() => handleCheckboxChange(user)}
                        className="checkboxList"
                      />
                      {user.user}
                      <div className="userSettings">
                        Duration: {user.duration} seconds
                      </div>
                    </li>
                  ))}
                </ul>
              </div>
            )}
          </ModalBody>
          <ModalFooter
            style={{ display: 'flex', justifyContent: 'space-between' }}
          >
            {allUsers.length > 0 && (
              <>
                <div>
                  <Button
                    style={{ backgroundColor: '#506266', border: 'none' }}
                    color="secondary"
                    onClick={() => handleBackClick()}
                  >
                    Cancel
                  </Button>
                  <Button
                    style={{ backgroundColor: '#506266', border: 'none' }}
                    className="selectButton"
                    onClick={() => handleSelectAllUsers(allUsers)}
                    color="primary"
                  >
                    Select All
                  </Button>
                </div>
                <div>
                  <Button
                    onClick={() => handleSubmitClick(saveDataset)}
                    color="secondary"
                  >
                    Submit
                  </Button>
                </div>
              </>
            )}
          </ModalFooter>
        </div>
      </Modal>
      {showNoUsers && (
        <div>
          {['warning'].map((variant) => (
            <Alert key={variant} color={variant}>
              No information found!
            </Alert>
          ))}
        </div>
      )}
    </div>
  )
}

export default MainPage
